import React from 'react';
import { Link } from 'react-router-dom';

function TransparentNavbar() {
  return (
    <nav className="bg-transparent w-full px-8 py-4 flex justify-between items-center">
      <div className="text-2xl font-bold text-black">
        <Link to="/">HistoricalWeb</Link>
      </div>
      <div className="flex space-x-4">
        <Link to="/login">
          <button className="text-black hover:text-blue-500">Login</button>
        </Link>
        <Link to="/signup">
          <button className="px-4 py-2 text-white font-semibold rounded-full hover:bg-blue-700">
            Get Started
          </button>
        </Link>
      </div>
    </nav>
  );
}

export default TransparentNavbar;
